    [],nt"num_tags": 6,nt"name": "izembek-national-wildlife-range-annual-narrative-report-calendar-year-1979",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Izembek, Eastern
    Aleutians, Semidi, and Simeonof NWRs outlines Refuge accomplishments during the
    1979 calendar year. The report begins with an introduction to the Refuge and information
    about weather conditions, habitat conditions, land acquisition activities, and the
    system status. Construction and maintenance are also described. Habitat management
    is covered; wetlands are discussed. The wildlife section of the report discusses
    endangered and threatened species, migratory birds, mammals, non-migratory birds,
    brown bears, and caribou. Interpretation and recreation activities are outlined;
    topics include information and interpretation, recreation, and law enforcement.
    Field investigations, cooperative programs, items of interest, and safety information
    are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
